import Header from './Header';
import Head from 'next/head'

const layoutStyle = {
    margin: 20,
    padding: 20,
    border: '1px solid #DDD'
}

const DefaultLayout = props => (
    <div style={layoutStyle}>
        <Head>
            <link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/reactstrap/4.8.0/reactstrap.min.js"></link>
        </Head>
        <Header />
        {props.children}
    </div>
);

export default DefaultLayout;
